interface IPancakeSwap {
    function swapExactTokensForTokens(uint256 amountIn, uint256 amountOutMin, address[] calldata path, address to, uint256 deadline) external returns(uint256[] memory amounts);
}

library TransferHelper {
    function safeReward(
        address token,
        address to,
        uint256 value
    ) internal {
        // bytes4(keccak256(bytes('mint(address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0x40c10f19, to, value));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'TransferHelper::safeReward: reward failed'
        );
    }

    function safeApprove(
        address token,
        address to,
        uint256 value
    ) internal {
        // bytes4(keccak256(bytes('approve(address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0x095ea7b3, to, value));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'TransferHelper::safeApprove: approve failed'
        );
    }

    function safeTransfer(
        address token,
        address to,
        uint256 value
    ) internal {
        // bytes4(keccak256(bytes('transfer(address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0xa9059cbb, to, value));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'TransferHelper::safeTransfer: transfer failed'
        );
    }

    function safeTransferFrom(
        address token,
        address from,
        address to,
        uint256 value
    ) internal {
        // bytes4(keccak256(bytes('transferFrom(address,address,uint256)')));
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(0x23b872dd, from, to, value));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'TransferHelper::transferFrom: transferFrom failed'
        );
    }

    function safeTransferBNB(address to, uint256 value) internal {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, 'TransferHelper::safeTransferBNB: BNB transfer failed');
    }
}

library PancakeHelper {
    function safeDeposit(
        address pancakeMasterChef,
        uint256 pid,
        uint256 amount
    ) internal {
        // bytes4(keccak256(bytes('deposit(uint256,uint256)')));
        (bool success, bytes memory data) = pancakeMasterChef.call(abi.encodeWithSelector(0xe2bbb158, pid, amount));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'PancakeHelper::safeDeposit: deposit failed'
        );
    }

    function safeWithdraw(
        address pancakeMasterChef,
        uint256 pid,
        uint256 amount
    ) internal {
        // bytes4(keccak256(bytes('withdraw(uint256,uint256)')));
        (bool success, bytes memory data) = pancakeMasterChef.call(abi.encodeWithSelector(0x441a3e70, pid, amount));
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            'PancakeHelper::safeWithdraw: withdraw failed'
        );
    }

    function safeSwapExactTokensForTokens(
        address pancakeSwap,
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) internal returns(uint256[] memory amounts){
        //really?
        //bytes4(keccak256(bytes('swapExactTokensForTokens(uint256,uint256,address[],address,uint256)')));
        (bool success, bytes memory data) = pancakeSwap.call(abi.encodeWithSelector(0x38ed1739, amountIn, amountOutMin, path, to, deadline));
        require(
            success,
            'PancakeHelper::safeSwapExactTokensForTokens: swap failed'
        );
        amounts = abi.decode(data, (uint256[]));
    }
}


contract FwarPools is FwarOwnable, ReentrancyGuard {
    using SafeMath for uint256;

    struct UserInfo {
        uint256 amount;
        uint256 rewardDebt;
        uint256 lastDepositedTime;
    }

    struct PoolInfo {
        address lpToken;  // pancake BEP20 lptoken's address
        uint256 pancakeLpId; // pancake pool LP stake ID
        uint256 allocPoint; // How many allocation points assigned to this pool. CAKEs to distribute per block.
        uint256 lastRewardBlock; // Last block number that CAKEs distribution occurs.
        uint256 accKeyPerShare; // Accumulated CAKEs per share, times 1e12. See below.
        uint256 lpSupply; // Total supply of LP pool
    }

    bool internal initialized;
    address internal teamWallet;
    address public devAddress;
    address internal pancakeMasterChef; // pancake masterChef's address
    address internal pancakeSwap; // pancake router's address
    address public key;  // key token's address

    // common
    uint256 public keyPerBlock;
    uint256 public totalAllocPoint;
    uint256 public startBlock;

    // transactionFee
    uint256 internal constant TRANSACTION_Fee_A = 50; // 0.5%
    uint256 internal constant TRANSACTION_Fee_B = 40; // 0.4%
    uint256 internal constant TRANSACTION_Fee_C = 30; // 0.3%
    uint256 internal constant TRANSACTION_Fee_D = 20; // 0.2%
    uint256 internal constant TRANSACTION_Fee_E = 10; // 0.1%

    // withdraw fee period
    uint256 internal constant FEE_PERIOD_A = 7 days;
    uint256 internal constant FEE_PERIOD_B = 14 days;
    uint256 internal constant FEE_PERIOD_C = 30 days;
    uint256 internal constant FEE_PERIOD_D = 90 days;
    uint256 internal constant FEE_PERIOD_E = 180 days;

    PoolInfo[] public poolInfo;
    mapping (uint256 => mapping (address => UserInfo)) public userInfo;
    event PoolStake(address indexed user, uint256 indexed pid, uint256 amount);
    event PoolWithdraw(address indexed user, uint256 indexed pid, uint256 amount);

    function initialize(
        address _initialOwner,
        address _key,
        uint256 _startBlock,
        uint256 _keyPerBlock,
        address _teamWallet,
        address _devAddress,
        address _pancakeMasterChef,
        address _pancakeSwap
    ) public {
        require(initialized == false, 'Initial must run once time');
        initialized = true;
        _owner =_initialOwner;
        startBlock = _startBlock;
        keyPerBlock = _keyPerBlock;
        teamWallet = _teamWallet;
        devAddress = _devAddress;
        pancakeMasterChef = _pancakeMasterChef;
        pancakeSwap = _pancakeSwap;
        key = _key;
        totalAllocPoint = 1;
    }

    // only called by owner once a day
    function setKeyPerBlock(uint256 _keyPerBlock) public onlyOwner {
        keyPerBlock = _keyPerBlock;
    }

    function setMasterChef(address _pancakeMasterChef) public onlyOwner{
        pancakeMasterChef = _pancakeMasterChef;
    }

    function setPancakeSwap(address _pancakeSwap) public onlyOwner {
        pancakeSwap = _pancakeSwap;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    function getMultiplier(uint256 _from, uint256 _to) public pure returns (uint256) {
        return _to.sub(_from);
    }

    function _getTransactionFee(uint256 _lastDepositedTime) internal view returns (uint256 transactionFee) {
        if (block.timestamp < _lastDepositedTime.add(FEE_PERIOD_A)) {
            transactionFee = TRANSACTION_Fee_A;
        } else if (block.timestamp < _lastDepositedTime.add(FEE_PERIOD_B)) {
            transactionFee = TRANSACTION_Fee_B;
        } else if (block.timestamp < _lastDepositedTime.add(FEE_PERIOD_C)) {
            transactionFee = TRANSACTION_Fee_C;
        } else if (block.timestamp < _lastDepositedTime.add(FEE_PERIOD_D)) {
            transactionFee = TRANSACTION_Fee_D;
        } else if (block.timestamp < _lastDepositedTime.add(FEE_PERIOD_E)) {
            transactionFee = TRANSACTION_Fee_E;
        } else transactionFee = 0;
    }


    //Get all key from all pools
    function getAllKey() public {
        for (uint i = 0; i < poolInfo.length; i++) {
            getKey(i);
        }
    }

    //Create a new pool
    function createPool(uint _allocPoint, address _lpToken, uint256 _pancakeLpId) public onlyOwner {
        uint256 lastRewardBlock = block.number > startBlock ? block.number : startBlock;
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        poolInfo.push(PoolInfo({
            lpToken: _lpToken,
            pancakeLpId: _pancakeLpId,
            allocPoint: _allocPoint,
            lastRewardBlock: lastRewardBlock,
            accKeyPerShare: 0,
            lpSupply: 0
        }));
    }

    //Set allocation point by poolId
    function setAllocPoint(uint256 _pid, uint256 _allocPoint) public onlyOwner {
        totalAllocPoint = totalAllocPoint.sub(poolInfo[_pid].allocPoint).add(_allocPoint);
        poolInfo[_pid].allocPoint = _allocPoint;
    }

    // View key pending by user
    function pendingKey(uint256 _id, address _user) external view returns (uint256) {
        PoolInfo storage pool = poolInfo[_id];
        UserInfo storage user = userInfo[_id][_user];
        uint256 accKeyPerShare = pool.accKeyPerShare;
        uint256 lpSupply = pool.lpSupply;
        if (block.number > pool.lastRewardBlock && lpSupply != 0) {
            uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
            uint256 keyReward = multiplier.mul(keyPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
            accKeyPerShare = accKeyPerShare.add(keyReward.mul(1e12).div(lpSupply));
        }
        return user.amount.mul(accKeyPerShare).div(1e12).sub(user.rewardDebt);
    }

    function updateAllPool() public {
        for (uint i = 0; i < poolInfo.length; i++) {
            updatePool(i);
        }
    }

    //Update pool by poolID
    function updatePool(uint _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        if (block.number <= pool.lastRewardBlock) {
            return;
        }
        uint256 lpSupply = pool.lpSupply;
        if (lpSupply == 0) {
            pool.lastRewardBlock = block.number;
            return;
        }
        uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
        uint256 keyReward = multiplier.mul(keyPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
        pool.accKeyPerShare = pool.accKeyPerShare.add(keyReward.mul(1e12).div(lpSupply));
        pool.lastRewardBlock = block.number;
    }

    // Stake to the pool
    function poolStake(uint256 _pid, uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];

        updatePool(_pid);
        if (user.amount > 0) {
            uint256 pending = user.amount.mul(pool.accKeyPerShare).div(1e12).sub(user.rewardDebt);
            if (pending > 0) {
                TransferHelper.safeReward(key, msg.sender, pending);
            }
        }
        if (_amount > 0) {
            TransferHelper.safeTransferFrom(pool.lpToken, msg.sender, address(this), _amount);
            TransferHelper.safeApprove(pool.lpToken, pancakeMasterChef, _amount);

            user.amount = user.amount.add(_amount);
            pool.lpSupply = pool.lpSupply.add(_amount);

            if(pool.pancakeLpId != 0) {
                PancakeHelper.safeDeposit(pancakeMasterChef, pool.pancakeLpId, _amount);
            }
        }

        user.rewardDebt = user.amount.mul(pool.accKeyPerShare).div(1e12);
        user.lastDepositedTime = block.timestamp;
        emit PoolStake(msg.sender, _pid, _amount);
    }

    // Withdraw from a pool
    function poolWithdraw(uint256 _pid, uint256 _amount) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        require(user.amount >= _amount, "withdraw: amount is exceed to balance");
        updatePool(_pid);
        uint256 pending = user.amount.mul(pool.accKeyPerShare).div(1e12).sub(user.rewardDebt);
        if (pending > 0) {
            TransferHelper.safeReward(key, msg.sender, pending);
        }

        if (_amount > 0) {
            user.amount = user.amount.sub(_amount);

            uint256 realAmount = _amount.sub(
                _amount.mul(_getTransactionFee(user.lastDepositedTime)).div(10000)
            );
            if(pool.pancakeLpId !=0) {
                PancakeHelper.safeWithdraw(pancakeMasterChef, pool.pancakeLpId, _amount);
                }
            pool.lpSupply = pool.lpSupply.sub(_amount);

            TransferHelper.safeTransfer(pool.lpToken, msg.sender, realAmount);
        }
        user.rewardDebt = user.amount.mul(pool.accKeyPerShare).div(1e12);

        emit PoolWithdraw(msg.sender, _pid, _amount);
    }

    //Get key from a pool
    function getKey(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updatePool(_pid);
        uint256 pending = user.amount.mul(pool.accKeyPerShare).div(1e12).sub(user.rewardDebt);
        if (pending > 0) {
            TransferHelper.safeReward(key, msg.sender, pending);
        }
        user.rewardDebt = user.amount.mul(pool.accKeyPerShare).div(1e12);
        emit PoolWithdraw(msg.sender, _pid, 0);
    }

    function pancakeToToken(address[] calldata _path, uint256 _amount, uint256 deadline) public onlyOwner returns (uint[] memory amounts){
        IBEP20(_path[0]).approve(pancakeSwap, _amount);
        amounts = IPancakeSwap(pancakeSwap).swapExactTokensForTokens(_amount, 0, _path, address(this), deadline); // expire time is about 20 min
        IBEP20(_path[1]).transfer(teamWallet, (amounts[amounts.length-1]).div(2));
        IBEP20(_path[1]).transfer(devAddress,(amounts[amounts.length-1]).div(2));
    }

     // receive BNB
    receive() external payable {

    }

    function getTokenRemaining(address _token, uint256 _amount, bool _isBNB) public onlyOwner{
        if (_isBNB) {
            TransferHelper.safeTransferBNB(teamWallet, _amount.div(2));
            TransferHelper.safeTransferBNB(devAddress, _amount.div(2));
        } else {
            TransferHelper.safeTransfer(_token, teamWallet, _amount.div(2));
            TransferHelper.safeTransfer(_token, devAddress, _amount.div(2));
        }
    }
}

